import React from "react";
import { Container, Card, Image } from "./styles/ProdutosListStyle";

const ProdutosList = ({ produtos }) => {
    return (
        <Container>
            {produtos.map((produto, i) => (
                <Card key={i}>
                    <Image key={i + 2}/>
                    <div key={i}>{produto.price}</div>
                    <div key={i + 1}>{produto.name}</div>
                </Card>
            ))}
        </Container>
    );
};

export default ProdutosList;
